import React, { useState } from "react";



const Projects = () => {
    const projects = ["gauss", "draco", "milk"];
    const [project, setProjects] = useState("");

    return (

        <div>

        <div>

        {projects.map(project=>(
        <button onClick={()=>setProjects(project)}>
            {project.toLocaleLowerCase()}
        </button>

        ))}


        </div>    


        </div>
    )

}



export default Projects;
